import React, { useState, useEffect } from 'react'
import './App.css';

export default function App() {

  useEffect(async () => {
    let response = await fetch('http://localhost:8080/promo')
    let data = await response.json()
    return data;
  })

  return (
    <div className="App">
      <h1>it works</h1>
    </div>
  )
}
